router.get("/createadmin", async (req, res) => {
    try {
        const user = new User({
            name: 'Tam',
            email: 'bear.roland@gmail.com',
            password: '1234',
            isAdmin: true,
        });
        const newUser = await user.save();
        res.send(newUser);
    } catch (error) {
        res.send({ message: error.message });
    }
});

export default router;

